// src/components/UserDashboard.js
import React from 'react';
import SubmitTicket from './SubmitTicket';
import './UserDashboard.css';

const UserDashboard = () => {
  return (
    <div className="user-dashboard">
      <h1>User Dashboard</h1>
      <SubmitTicket />
    </div>
  );
};

export default UserDashboard;
